import { SET_PROFILE } from "./profileAction";

const initialState = {
	deck: "numbers_1",
	gender: "",
	language: "english",
	level: "1",
	profile_created: false,
};

const reducer = (state = initialState, action) => {
	switch (action.type) {
		case SET_PROFILE:
			return {
				...state,
				gender: action.payload.gender,
				language: action.payload.language,
			};
		default:
			return state;
	}
};

export default reducer;
